  [],\n\t\"revision_timestamp\": \"2015-07-08T19:22:47.589164\",\n\t\"name\": \"toms-earth-probe-ozone-o3-total-column-1-orbit-l2-swath-50x50-km-v008\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"Total Ozone Mapping Spectrometer (TOMS)instruments
  have been successfully flown in orbit aboard the Nimbus-7(Nov. 1978 - May 1993),
  Meteor-3 (Aug. 1991 - Dec. 1994), Earth Probe (July 1996 - current), and ADEOS (Sep.
  1996 - June 1997) satellites. Since last thirty years, TOMS data have been providing
  useful information related to the ozone depletion, recovery and global trend. The
  Earth Probe, Meteor-3 and Nimbus-7 Total Ozone Mapping Spectrometer (TOMS) data
  are currently reprocessed using version-8 algorithm ( http://ozoneaq.gsfc.nasa.gov/documents.md
  ). n                  nThe TOMS version 8 daily Level-2 swath data product consists
  of total column ozone, aerosol index, and Lambertian effective surface reflectivity
  (Rayleigh corrected) at approximately 50x50 km resolution (at nadir). This product
  also contains some auxiliary derived and ancillary parameters including N-values,
  SO2 index, cloud fraction, cloud pressure, ozone below clouds, terrain height, geolocation,
  solar and satellite viewing angles, and data quality flags.n                  n(The
  shortname for this Level-2 Earth Probe TOMS Product is TOMSEPL2) nnThese Level-2
  data are stored in the EOS version of Hierarchical Data Format 5 (HDF-EOS5) and
  are available from the Goddard Earth Sciences (GES) Distributed Active Archive Center
  (DAAC). n                                          nTOMS data are produced by the
  Laboratory for Atmospheres at NASA Goddard Space Flight Center (Code 613.1). The
  Version-8 Algorithm Theoretial Basis Document (ATBD)is available from the TOMS site
  http://ozoneaq.gsfc.nasa.gov/documents.md\",\n\t\"license_title\": \"U.S. Government
